import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to navigate to products page
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');
    await page.waitForLoadState('networkidle');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_selected.png'));

    // Wait for and click the sort dropdown
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.click('#sortSelect');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_sort_dropdown.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_sort_dropdown.png'));

    // Select price low to high option
    await page.selectOption('#sortSelect', 'price-low');
    await page.waitForLoadState('networkidle');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sort_applied.png'));

    // Verify sort was applied by checking the selected option
    const sortValue = await page.$eval('#sortSelect', select => select.value);
    const sortText = await page.$eval('#sortSelect option:checked', option => option.textContent);

    return {
      success: true,
      action: "Applied price sort filter (low to high)",
      extractedData: {
        sortValue: sortValue,
        sortText: sortText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
